import React from 'react'
import Links from './Routes'
import ProtectedRoutes from './ProtectedRoutes'
import second from ''
const App = () => {
    {
        Links?.map((route, index) => (route?.private ? <ProtectedRoutes /> : <Route path={route?.path} element={route?.Component} />))
    }
}



export default App
